import React from 'react';

export const SphereButtonStyles = `
.SphereButton {
    box-sizing: border-box;
    background-size: contain;
    background-repeat: no-repeat;
    transition: transform 0.2s;
    background-position: center;
    height: 56px;
    width: 56px;
    cursor: pointer;
}

.SphereButton:hover {
    transform: scale(1.1);
}

.SphereButton.active {
    animation: rotation 2s linear infinite;
}
`;

export const SphereButtonMDStyles = `
    height: 50px;
    width: 50px;
`;

export const SphereButtonSMStyles = `
    height: 32px;
    width: 32px;
`;

const assistantSphereIcon =
    'data:image/png;base64,';

export const SphereButton: React.FC<{
    onClick: () => void;
    recording: boolean;
}> = ({ onClick, recording }) => {
    return (
        <div
            className={recording ? 'SphereButton active' : 'SphereButton'}
            onClick={onClick}
            style={{
                backgroundImage: `url(${assistantSphereIcon})`,
            }}
        />
    );
};
